import axios from 'axios'

const API_URL= 'http://localhost:2000'

class AuthenticationRequest {

    registerNewUser(userInfo) {
        return axios.post(`${API_URL}/authenticate`, {
            username,
            password
        })
    }

}

export default new AuthenticationRequest()
